    }



    const [cart, setCart] = useState(false);
    const handleAddCart = (e) => {
      setCart(true);  
      setTimeout(() => {
       setCart("")
      }, 3000);
    };




    //    const getIphone = async ()=>{
    //     const url = "http://localhost:5000/iphone/iphone11"

    //     const response = await fetch(url);
    //     const responseJson = await response.json();

    //     setIphone(responseJson.iphone)
    // }



        // useEffect(()=>{
        //   getIphone()
        // },[])

  return (

  <div className='choose'>


      <h1>מידע</h1>
      <p>
לורם איפסום דולור סיט אמט, קונסקטורר אדיפיסינג אלית קולהע צופעט למרקוח איבן איף, ברומץ כלרשט מיחוצים. קלאצי נולום ארווס סאפיאן - פוסיליס קוויס, אקווזמן קונדימנטום קורוס בליקרה, נונסטי קלובר בריקנה סטום, לפריקך תצטריק לרטי.

הועניב היושבב שערש שמחויט - שלושע ותלברו חשלו שעותלשך וחאית נובש ערששף. זותה מנק הבקיץ אפאח דלאמת יבש, כאנה ניצאחו נמרגי שהכים תוק, הדש שנרא התידם הכייר וק.

ושבעגט ליבם סולגק. בראיט ולחת צורק מונחף, בגורמי מגמש. תרבנך וסתעד לכנו סתשם השמה - לתכי מורגם בורק? לתיג ישבעס.

גולר מונפרר סוברט לורם שבצק יהול, לכנוץ בעריר גק ליץ, ושבעגט ליבם סולגק. בראיט ולחת צורק מונחף, בגורמי מגמש. תרבנך וסתעד לכנו סתשם השמה - לתכי מורגם בורק? לתיג ישבעס.

ליבם סולגק. בראיט ולחת צורק מונחף, בגורמי מגמש. תרבנך וסתעד לכנו סתשם השמה - לתכי מורגם בורק? לתיג ישבעס.</p>




   <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">
      <CardContent>

      <InputLabel id="demo-simple-select-label">:בחר צבע</InputLabel>
    <FormControl fullWidth>
  <Select value={color} onChange={handleChooseColor}>
    <MenuItem style={{background:"#FF0000"}} value="Red(PRODUCT)">Red(PRODUCT)</MenuItem>
    <MenuItem style={{background:"#2B333D"}} value="Midnight">Midnight</MenuItem>
    <MenuItem style={{background:"#FFDAB9"}} value="Starlight">Starlight</MenuItem>
    <MenuItem style={{background:"#DDA0DD	"}} value="Purple">Purple</MenuItem>
  </Select>
</FormControl>
  </CardContent>


    <CardContent>
    <InputLabel id="demo-simple-select-label">:בחר זיכרון</InputLabel>
    <FormControl fullWidth>
  <Select value={gb} onChange={handleChooseGB}>
    <MenuItem value="128GB">128GB</MenuItem>
    <MenuItem value="256GB">256GB</MenuItem>
    <MenuItem value="512GB">512GB</MenuItem>
    <MenuItem value="1TB">1TB</MenuItem>
  </Select>
</FormControl>

    </CardContent>
    </Card>

    {!cart ? <Stack sx={{ width: '100%' }} spacing={2}>



      <Button onClick={handleAddCart} variant="contained">להוסיף לסל</Button>
      </Stack>
    : <Alert  severity="success">Iphone 11 - Color:{color} , GB:{gb} - add to cart!</Alert>}

    </Box>

  </div>
  )
}

export default Iphone11
